import numpy as np
from environments import environment


def get_best_policy(q_table, cheat=False):
    policy: list = []
    if q_table is None:
        return policy
    for state in q_table:
        a = np.argmax(state)
        policy.append(a)
    return policy


def get_best_policy_osi(pso_nn, env):
    # return pso_nn.best_individual
    policy: list = []
    for state in range(env.observation_space.n):
        a = np.argmax(pso_nn.best_individual.predict(np.identity(env.observation_space.n)[state:state + 1]))
        policy.append(a)
    return policy


def get_best_path(q_table):
    policy = []
    if len(q_table) == 192:
        policy = [0]
        policy += [1]*11
        policy += [2]
        return policy
    elif len(q_table) == 768:
        policy = [0]*2
        policy += [1]*23
        policy += [2]*2
        return policy
    elif len(q_table) == 3072:
        policy = [0]*4
        policy += [1]*47
        policy += [2]*4
        return policy
    elif len(q_table) == 12288:
        policy = [0]*8
        policy += [1]*95
        policy += [2]*8
    return policy



def get_benchmark_policy(model_name: str):
    print(f"\n\n\tMODEL NAME: {model_name}")
    if environment.current_environment["type"] == "4x4":
        return benchmark_q_table_fl_4x4_q
    elif environment.current_environment["type"] == "8x8":
        return benchmark_q_table_fl_8x8_q
    elif environment.current_environment["type"] == "16x16":
        return benchmark_q_table_fl_16x16_q
    elif environment.current_environment["type"] == "small":
        if "Q" in model_name:
            return benchmark_q_table_small_q
        else:
            return benchmark_q_table_small_e
    elif environment.current_environment["type"] == "large":
        if "Q" in model_name:
            return benchmark_q_table_large_q
        else:
            return benchmark_q_table_large_e
    elif environment.current_environment["type"] == "mega":
        if "Q" in model_name:
            return benchmark_q_table_mega_q
        else:
            return benchmark_q_table_mega_e
    else:
        if "Q" in model_name:
            return benchmark_q_table_small_q
        else:
            return benchmark_q_table_small_e


def print_policy_string(current_policy: list):
    factor = 1
    if environment.current_environment["type"] == "4x4":
        factor = 4
    elif environment.current_environment["type"] == "8x8":
        factor = 8
    elif environment.current_environment["type"] == "16x16":
        factor = 16
    elif environment.current_environment["type"] == "small":
        factor = 12
    elif environment.current_environment["type"] == "large":
        factor = 24
    elif environment.current_environment["type"] == "mega":
        factor = 48
    policy_str: str = ""
    for i in range(0, len(current_policy)):
        policy_str += f"{current_policy[i]} "
        if (i + 1) % factor == 0:
            policy_str += "\n"
    print(policy_str)


